import "./Notific.css";
function Notific({ notifCount="0" }) {
  if (notifCount > 0) {
    return (
      <>
        <a href="#" class="notification">
          <span>notification</span>
          <span class="badge">{notifCount}</span>
        </a>
      </>
    );
  }
}
export default Notific;
